svg.script:
	function listBBoxes()
	{
		// Get all of the elements.
		//var ids = 's g c r p pl pg e i f an l t ts tp tr ta u a v'.split(' ');
		var ids = ["s", "g", "c", "r", "p", "pl", "pg", "e", "i", "f", "an", "l", "t", "ts", "tp", "tr", "ta", "u", "a", "v"];
		var result = "";

		for (var k = 1; k < 5; k++)
		{
			result += " Running tests #" + k +" ";

			for (var i in ids) {
			  var elm = document.getElementById(ids[i] + k);

			  try
			  {
				  var bbox = elm.getBBox();
				  var screenbbox = elm.getScreenBBox();
				  result += "id: " + (ids[i]+k) + " BBox: " + bbox.x.toFixed(0) + "," + bbox.y.toFixed(0) + "," + bbox.width.toFixed(0) + "," + bbox.height.toFixed(0) + 
							" ScreenBBox: " + screenbbox.x.toFixed(0) + "," + screenbbox.y.toFixed(0) + "," + screenbbox.width.toFixed(0) + "," + screenbbox.height.toFixed(0) + " -- ";

				  drawBBox(bbox,k);
			  }
			  catch(e)
			  {
				result += "id: " + (ids[i]+k) + "(" + elm + ") does not support SVGLocatable."
			  }

			}
		}

		//bbox = document.getElementById("tp3").getBBox();
		//result += "tp3: " +  bbox.x.toFixed(0) + "," + bbox.y.toFixed(0) + "," + bbox.width.toFixed(0) + "," + bbox.height.toFixed(0);
		//bbox = document.getElementById("tp4").getBBox();
		//result += " tp4: " + bbox.x.toFixed(0) + "," + bbox.y.toFixed(0) + "," + bbox.width.toFixed(0) + "," + bbox.height.toFixed(0);
		//drawBBox(bbox,4);
		//alert(result);
		opera.postError(result);
	}

    function drawBBox(bbox,k)
	{
		var r = document.createElementNS("http://www.w3.org/2000/svg", "rect");
		r.setAttribute("x", bbox.x);
		r.setAttribute("y", bbox.y);
		r.setAttribute("width", bbox.width);
		r.setAttribute("height", bbox.height);
		r.setAttribute("fill", "none");
		r.setAttribute("stroke", "orange");
		r.setAttribute("stroke-opacity", "0.2");
		//r.setAttribute("stroke-width", 10-k*2);
		document.getElementById("svgroot").appendChild(r);
	}
